      <input
        type="text"
        value={lastname}
        onChange={(e)=>setLastName(e.target.value)}
      />
      <h2>{firstname  }</h2>
      {/* <h2>lastname is {lastname}</h2> */}
      <br/>
      {/* <button onClick={handleClick}>Click me</button> */}
    </div>
  );
}

export default App;
